import React from "react";
import logo from "./../images/logo.png";
import {
  Card,
  CardImg,
  Collapse,
  Navbar,
  NavbarToggler,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
} from "reactstrap";

export const Footer = () => (
    <footer className="footer">
      <Card style={{height:"70px"}} className="pl-3" >
          <CardImg src={logo} style={{width:"70px"}} className="h-100 ml-3"></CardImg>
      </Card>
    </footer>
  );
